import React from 'react';
import { Card } from 'react-bootstrap';
import PropTypes from 'prop-types';

function Intern(props) {
    return (
        <div className='intern-section'>
            <Card className="intern-card">
                <h4>{props.role}</h4>
                <h5>{props.name}</h5>
                <p className="intern-date"><b>{props.date}</b></p>
                <ul>
                    <li>Automated report generation process using Python to track business performance.</li>
                    <li>Assisted in ongoing data analysis to identify opportunities for driving business success.</li>
                    <li>Analysed audience performance data throughout the customer journey across the marketing tech stack (Customer Data Platform) to optimise customer journey.</li>
                    <li>Collaborated with the different marketing teams to optimise conversion rates and KPIs through data analysis across channels such as media, website and mobile.</li>
                </ul>
            </Card>
        </div>
    )
}


Intern.propTypes = {
    role: PropTypes.string.apply.apply,
    name: PropTypes.string,
    date: PropTypes.string
  };

export default Intern;
